import React from 'react';

const Body = () => {
    const style = {
        backgroundColor: "#f8f9fa",
        height: "200px"

    };
    return (
        <>
            <div className="container">
                <div className="row">
                    <div className="col-md-7 offset-md-1" style={style}></div>
                    <div className="col-md-4"></div>
                </div>
            </div>
        </>
    );
};

export default Body;
